    {
      "date": null,
      "tags_section": null,
      "text": "16. Bey hrn. Rudolf Ramsperger an der Huthgass ist extra guter holländer Taback in bleyernen Pfund-Büchsen à 10 Bazen, wie auch guter St. Vincent à 3 ß. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "17. Wo guter Art grosse Bohnen zum Sezen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor - Huth, mittelmässiger Grösse, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "19. Bey hrn. Burkhardt zum Riesen ist extra neue grosse Italiänische Feigen, dito grosse Meertrauben mit und ohne Stiel, haselnuss, dürre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "20. Zwölf Sack neuer Waisen in billigem Preis, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "21. Bey hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 63 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jezigen Kriegs. 2) Die Welt in einer Nuss mit Kupfern. 3) Ein Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "22. Zwey sauber französische Bether in ein Wirths-haus auf das Land oder in ein Bad dienlich, ohnentgeldtlich im Berichtthauss zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "23. Eine Behausung in der Reichemer Vorstadt mit 4 Stuben, 5 Kammern sammt einer grossen Werkstatt, Estrig und einem schönen gewölbten Keller und Garten, weshalb sich bey hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf-Saamen anders liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbigen dahero in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Kieser zu vernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "26. Circa 6. Saum extra guter alter pur rother Pössteiner-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "27. Zwey Stücklein weissen Wein von 1756. à 8 Pfund 10 ß der Saum im einen, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "28. Ein Stock heu ab 7 Thänen Matten vorm Riechemer-Thor oberhalb der Schorendruck. Ferner ein Stücklein von 17 Saumen rothen Völliger-Wein von 1760. schön roth und lauter, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "29. Auf E. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Im Offenburger - Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "32. Ein Brennhäuslein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piecenweiss wegen Mangel Plazes, wie auch roth und weisser 1753iger Margräser-Wein in billigem Preis zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "34. Keine heitergelbe hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweiss zu haben, ist im Berichtshause ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "35. Herrn holzach des Stegriss Behausung im Spieg-Hässlein mit 4 Stuben, 3 Kammern &c. ist entweder zu verkaufen, oder samthafft zu verlehen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "36. Weisse und rothe Margräser - Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "37. Ein Mannssiz in St. Peters Kirch auf dem Leitner. Item ein grün Tombeau-Bettslein mit grünen wollenen Umhängen, in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "38. Ein Hausschlitten mit einem schönen Bild und Zugehördt in billigem Preis, im Berichtshause zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "39. Der Bärensser - Hof zu St. Peter, mit Garten, Stallung, Keller &c. wie der Augenschein zeigen wird. In Ermanglung eines Käufers"
    }
  ]
}

